app.controller("consumedservice",["$scope","consumedServiceAPIService","$stateParams","storageService","dialogService","routeService",function(n,t,i,r,u,f){n.title="服务记录";n.routeName="consumedservices";n.consumedService=null;n.userId=r.getUserId();n.consumedServiceId=i.consumedServiceId;t.getConsumedService(i.consumedServiceId).then(function(t){n.consumedService=t.data});n.delete=function(){u.showMention(2,"确定要删除此消费单吗？",null,null,function(){t.deleteConsumedService(i.consumedServiceId).then(function(){f.goParams("consumedservices")})})}}]);